import React from "react";
import "./App.css";
import Card from './Componentes/Card'
import Primera from './Componentes/primera.jpg'


function App() {
  const imagenes = [
    {
      img: Primera,
      title: "LUNES",
      subtitle: "Powerful Women",
      color: "#00FFFF",
      ejercicio:"Rutina",
      texto1:
        "Bicicleta",
        texto2:
        "Eliptico 15'",
        texto3:
        "Cinta 20'",
        texto4:
        "Abdominales",
        texto5:
        "Sentadillas 3x15",
        texto6:
        "Estocadas 3x10"
    }
  ];
  return (
    <div>
      {imagenes.map(card => {
        return (
          <Card
            title={card.title}
            color={card.color}
            img={card.img}
            ejercicio={card.ejercicio}
            texto1={card.texto1}
            texto2={card.texto2}
            texto3={card.texto3}
            texto4={card.texto4}
            texto5={card.texto5}
            texto6={card.texto6}
          ></Card>
        ); 
      })}
    </div>
  );
}

export default App;
